  return (
    <Container>
      <ProductsList>
        {products.map((product) => (
          <ProductItem></ProductItem>
        ))}
      </ProductsList>
    </Container>
  );
};

export default AdminProducts;

const Container = styled.div`
  grid-area: main;
  padding: 100px 20px;
`;
